import React, { Component } from 'react';
import { Input, Menu } from 'semantic-ui-react';

const color = ['white'];

const Navbar = props => {
	return (
		<Menu color={color} secondary>
			<Menu.Item name='ورود / ثبت‌نام' />
			<Menu.Menu position='right'>
				<Menu.Item name='لوگو' color='white' />
				<Menu.Item name='چرا تیزتایپ؟' />
				<Menu.Item name='تعرفه‌ها' />
				<Menu.Item name='جطور کار میکنه؟' />
			</Menu.Menu>
		</Menu>
	);
};

export default Navbar;
